import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Notes from ".Notes";

function newNotes(props) {
  return (
    <noteDetails
      key={props.key}
      nTitle={props.title}
      nContent={props.content}
    />
  );
}

function App() {
  return (
    <div>
      <Header />
      <Footer />
      {Notes.map(newNotes)}
      <noteDetails />
    </div>
  );
}
export default App;
